    <div>

<div className='homeList'>
      {items.map((menuItem, Key )=>{
        return (
        <MenuItem 
                  id={menuItem.id}
                  Key={Key} 
                  image={menuItem.image} 
                  name={menuItem.name} 
                  price={menuItem.price}
                  />
        );
    })}
    </div>


    </div>
  )
}

